import React from "react";
import Nav from "../Nav/Nav"
import Header from "../Header/Header"
import API from "../../utils/API"
import Displaybooks from "../Displaybooks/Displaybooks"

export default class Savedbooks extends React.Component {

    state = {
        books: []
      };

    componentDidMount() {
        API.getBooks()
          .then(res => this.setState({ books: res.data }))
          .catch(err => console.log(err));
      }
      

    render() {
        const { books } = this.state
        console.log(books)
        return (
            <div>
                <Nav />
                <Header />
                <span> {books.map((book) => {
                    let { title, description, imageLinks, authors, infoLink } = book
                    console.log("images are " + imageLinks.thu)
                    return (
                        <div key={book._id}>
                            <Displaybooks title={title} description={description} imageLinks={imageLinks} authors={authors} infoLink={infoLink}
                                onClick={() => {
                                    console.log("you clicked me ")

                                    // this.savebook(book.volumeInfo)
                                    // console.log(infoLink)

                                }}
                            />
                        </div>

                    )

                }
                )}
                </span>
               
            </div>
        )

    }

}
